import React from "react";

function Header() {
    return <header>
        <nav id="head0">
            <ul>
                <li><b>OurOneNote</b></li>
                <li id="center">My NoteBook</li>
                <li><button type="button"> <img src="images/login.jpg" /></button></li>
            </ul>
        </nav>
    </header>
}

export default Header;
